(i) any Contract (A) with a Significant Customer or
(B) with any other customer involving the sale of provision of Company Products, services or other assets that has generated, during the period from January 1, 2018 to March 31, 2019, more than $2,500,000 in revenues on a consolidated
basis recognized in accordance with GAAP for the Company and the Subsidiaries;

(ii) any Contract (A) with a Significant Supplier or (B) for the
purchase, manufacture or license by the Company or any Subsidiary of components, materials, supplies, equipment, parts, subassemblies, software, Intellectual Property or other assets that are included in or used in connection with the provision of
Company Products and that required the Company or such Subsidiary to either recognize expense in accordance with GAAP, or make cash payments, in excess of $2,500,000 during the period from January 1, 2018 to March 31, 2019;

(ix) all licenses, sublicenses and other Contracts that are material to the conduct of the Business and pursuant to which the
Company or any Subsidiary acquired or is granted any right in or to any Third-Party Intellectual Property or is authorized to market, distribute or resell any product, service or Third-Party Intellectual Property, other than Standard Inbound IP
Agreements and Contracts identified in subsection (ii) of Schedule 2.17(a) of the Company Disclosure Letter;

(xi) any Contract providing for the development of any Intellectual Property for the Company or any Subsidiary (other than
Standard Inbound IP Agreements and employee invention assignment agreements, consulting agreements and independent contractor agreements with Authors on the Company’s standard form of agreement, copies of which have been made available to
Parent) that is material to the Company’s Products;

(xii) (A) any joint venture Contract or other Contract that
involves a sharing of revenues or profits with any other Person or (B) any Contract that involves the payment of royalties to any other Person (excluding, in each case, annual or routine maintenance and license fees for Third Party Intellectual
Property that are not contingent on the manufacturing, sale or use of Company Products);

(i) export control laws and regulations administered or enforced by the U.S. government, including such as
the Export Administration Regulations, 15 C.F.R. §§ 730, et seq. and the International Traffic in Arms Regulations, 22 C.F.R. §§ 120, et seq., and other controls administered by the U.S. Department of Commerce and/or the U.S.
Department of State;

